function convert (json) {
  var new_json = false;
  new_json.id = json.id;
  new_json.name = json.name;
  new_json.data = {"uri":json.id,"category":json.category};
  //new_json.data['uri'] = json.id;
  //new_json.data['category'] = json.category;
  new_json.children = new Array();
  for (i = 0 ; i < json.relatedItems.length ; i++){
    item = json.relatedItems[i];
    new_json.children.push({id:item.id, name:item.name});
  }

  return new_json;
}

