function change_view(uri, category){
  visited.push(Array(category,uri.replace('http://dbpedia.org/resource/','')));
  json = recommend(uri,category);
  json = convert(json);
  rgraph.loadJSON(json);

  if (category == 'Film'){
    rgraph.graph.Node.color = '#83548B';
    rgraph.graph.Node.type = 'circle';
  }
  else if (category == 'Person'){
    rgraph.graph.Node.color = '#70A35E';
    rgraph.graph.Node.type = 'square';
  }
  else if (category == 'Book'){
    rgraph.graph.Node.color = '#416D9C';
    rgraph.graph.Node.type = 'triangle';
  }

  rgraph.refresh();
  browsing_history();
  dbpedia(rgraph.graph.getNode(rgraph.root).data.uri,rgraph.graph.getNode(rgraph.root).data.category);
}

function browsing_history(){
  var html = "<h3 id='nav_his_title'>Browsing history</h3>";
  html += "<table id='nav_his_list'>";
  html += "<tr><td>User</td></tr>";
  for (i = 0 ; i < visited.length ; i++ ){
    html += "<tr><td><img src='data:image/png;base64,' style='width:20px;'/></td></tr>";
    html += "<tr><td><a href='#' onclick=\"change_view('http://dbpedia.org/resource/"+visited[i][1]+"','"+visited[i][0]+"')\">"+visited[i][0]+":"+visited[i][1]+"</a></td></tr>";
  }
  html += "</table>";
  $("#id-list")[0].innerHTML = html;
}